const useStyles = makeStyles({
    depositContext: {
      flex: 1,
    },
  });
class StockPopup extends React.Component {

  render (){ 
      return (
 <React.Fragment>

    <Typography component="p" variant="h4">
      $3,024.00
    </Typography>
    <Typography color="textSecondary" className={useStyles.depositContext}>
      on 15 March, 2019
    </Typography>
    <div>
      <Link color="primary" href="#" >
        View balance
      </Link>
    </div>
    <StockPopup/>
  </React.Fragment>
    );

  }
}

export default StockPopup;
